import React from "react";

const Extraimg = () => {
  return (
    <>
       <div className="same-img">
          <div className="img-deta-same">
            {sameim.map((res) => {
              return (
                <>
                  <div
                    className="img-res"

                    onClick={() => {navigate(`/${res.id}`)}}
                    key={res.id}
                  >
                    <img
                      className="on-img"
                      src={res.webformatURL}
                      alt="img.jpg"
                    />
                  </div>
                </>
              );
            })}
          </div>
        </div>
    </>
  );
};

export default Extraimg;
